import React from 'react'
import {makeStyles} from "@material-ui/core/styles";
import {Typography, Box} from "@material-ui/core";
import Navbar from "./Navbar";
import Typed from 'react-typed';

const useStyles = makeStyles(theme=>({
    mainContainer: {
        background: "#5A5A5A"
    },
    timeLine: {
        position: "relative",
        padding: "1rem",
        margin: "0 auto",
        "&:before": {
            content: "''",
            position: "absolute",
            height: "100%",
            border: "1px solid gray",
            right: "40px",
            top: 0
        },
        "&:after": {
            content: "''",
            display: "table",
            clear: "both"
        },
        [theme.breakpoints.up("md")]:{
            padding: "2rem",
            "&:before": {
                left: "calc(50% - 1px)",
                right: "auto"
            }
        }
    },
    timeLineItem: {
        padding: "1rem",
        borderBottom: "2px solid white",
        position: "relative",
        margin: "1rem 3rem 1rem 1rem",
        clear: "both",
        "&:after": {
            content: "''",
            position: "absolute"
        },
        "&:before": {
            content: "''",
            position: "absolute",
            right: "-0.625rem",
            top: "calc(50% - 5px)",
            borderStyle: "solid",
            borderColor: "gray gray transparent transparent",
            borderWidth: "0.625rem",
            transform: "rotate(45deg)"
        },
        [theme.breakpoints.up("md")]: {
            width: "44%",
            margin: "1rem",
            "&:nth-of-type(2n)": {
                float: "right",
                margin: "1rem",
                borderColor: "white"
            },
            "&:nth-of-type(2n):before": {
                right: "auto",
                left: "-0.625rem",
                borderColor: "transparent transparent gray gray"
            }
        }
    },
    timeLineYear:{
        textAlign: "center",
        maxWidth: "9.375rem",
        margin: "0 3rem 0 auto",
        fontSize: "1.8rem",
        background: "gray",
        color: "white",
        lineheight: 1,
        padding: "0.5rem 0 1rem",
        "&:before": {
            display: "none"
        },
        [theme.breakpoints.up("md")]: {
            textAlign: "center",
            margin: "0 auto",
            "&:nth-of-type(2n)":{
                float: "none",
                margin: "0 auto"
            },
            "&:nth-of-type(2n):before": {
                display: "none"
            }
        }
    },
    heading: {
        color: "white",
        align: "center",
        padding: "3rem 0",
        textTransform: "uppercase"
    },
    subHeading: {
        color: "white",
        padding: "0",
        textTransform: "uppercase"
    },
    company: {
        color: "white"
    },
    description: {
        color: "gray"
    }
}));

const Resume = () => {
    const classes = useStyles();
  return (
    <>
    <Navbar />
    <Box component="header" className={classes.mainContainer}>
        <Typography variant="h4" align = "center" className = {classes.heading}>
        <Typed strings= {["Work Experience"]} typeSpeed={40} />
        </Typography>
        <Box component= "div" className ={classes.timeLine}>
        <Typography variant="h2" 
            className={`${classes.timeLineYear} ${classes.timeLineItem}`}>
                Sep. 2020
            </Typography>
            <Box component="div" className = {classes.timeLineItem}>
                <Typography variant= "h5" align= "center" className = {classes.subHeading}>
                    UCLA Computer Science B.S.
                </Typography>
                <Typography variant= "body1" align= "center" className = {classes.company}>
                 Technology Management Technical Breadth
                </Typography>
                <Typography variant= "subtitle1" align= "center" className = {classes.description}>

                </Typography>
            </Box>
            <Typography variant="h2" 
            className={`${classes.timeLineYear} ${classes.timeLineItem}`}>
                 Jun 2022 - Aug 2022
            </Typography>
            <Box component="div" className = {classes.timeLineItem}>
                <Typography variant= "h5" align= "center" className = {classes.subHeading}>
                    CEO & Cofounder
                </Typography>
                <Typography variant= "body1" align= "center" className = {classes.company}>
                    Non-Fungible Studio
                </Typography>
                <Typography variant= "subtitle1" align= "center" className = {classes.description}>
                Spearheaded the creation of a web3 management and incubation service platform for innovative NFT projects and companies
                Formed a strategic partnership with Dissrup, an industry-leading curated art marketplace, driving $1 million+ in revenue
                Boosted Dissrupâ€™s conversion rate by 25% through marketing and business development consultation

                </Typography>
            </Box>
            <Typography variant="h2" 
            className={`${classes.timeLineYear} ${classes.timeLineItem}`}>
                Mar 2022 - Dec 2022
            </Typography>
            <Box component="div" className = {classes.timeLineItem}>
                <Typography variant= "h5" align= "center" className = {classes.subHeading}>
                    Web3 Consultant & Community Expert
                </Typography>
                <Typography variant= "body1" align= "center" className = {classes.company}>
                    Nastie Labs
                </Typography>
                <Typography variant= "subtitle1" align= "center" className = {classes.description}>
                    Hired as an advisor at Nastie Labs, a software development startup that focuses on blockchain technology to develop community-focused NFTs, Play-and-Earn gaming, and other projects
                </Typography>
            </Box>
        </Box>
    </Box>
    </>

  );
};

export default Resume
